  left outer join jiveuserprofile district on district.userid=u.userid and district.fieldid=5023
  left outer join jiveuserprofile facility on facility.userid=u.userid and facility.fieldid=5024
  left outer join jiveuserprofile occupation on occupation.userid=u.userid and occupation.fieldid=5026
  left outer join jiveuserprofile phone on phone.userid=u.userid and phone.fieldid=4
  left outer join jiveuserprofile biography on biography.userid=u.userid and biography.fieldid=8

  where (visible!=0 or status!=6) -- gets rid of weird system users
    and status<>7
    and lower(firstname) <> 'listserv'

  order by u.userid

